import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Provider } from 'react-redux';
import reducer from './reducers/rootreducer';
import { createStore } from 'redux';
import thunk from 'redux-thunk';
import { applyMiddleware } from 'redux';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import BodyDiagram from './components/scripts/general pages/bodydiagram';
import {createStateSyncMiddleware, initMessageListener} from 'redux-state-sync';
import { persistStore, persistReducer } from 'redux-persist';
import storage from 'redux-persist/lib/storage' // defaults to localStorage for web



const persistConfig = {
  key: 'root',
  storage,
}

const persistedReducer = persistReducer(persistConfig, reducer)

const reduxStateSyncConfig = {};

const store = createStore(persistedReducer, applyMiddleware(thunk, createStateSyncMiddleware(reduxStateSyncConfig)))



ReactDOM.render(
  <React.StrictMode>
    <Provider store={store} >
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} >
          <Route path="body" element={<BodyDiagram />} />
        </Route>
      </Routes>
    </BrowserRouter>

    </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
initMessageListener(store);
